CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_PopulateAbstract` (IN `conID` INT, IN `eID` INT, IN `abs` TEXT)  BEGIN
	DECLARE existID INT;
    DECLARE abID INT;
    
    SELECT a.contributorID INTO existID
    FROM eventcontributor a 
    WHERE a.contributorID = conID and a.eventID = eID;
    
    IF conID = existID
