        FROM abstract a
        WHERE a.eventID = eID and a.contributorID = conID;
        
        DELETE
        FROM abstractattachments
        WHERE abstractID = abID;
        
        SELECT abID as abstractID;
	ELSE
    	SELECT -1 as abstractID;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_PopulateAbstractAttachments` (IN `abID` INT, IN `att` LONGBLOB, IN `n` VARCHAR(500), IN `t` VARCHAR(30), IN `s` INT)  BEGIN
